import './App.scss';
import {Container} from "react-bootstrap";
import AppRoutes from "./components/routers/AppRoutes";

const App = () => {
    return (
        <div className="app-container">
            <Container>
                <AppRoutes></AppRoutes>
            </Container>
        </div>
    );
}

export default App;
